import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './login/style.scss'; // Import your custom CSS for additional styling
import { Navigate, useNavigate } from 'react-router-dom';

import { Button, createTheme, ThemeProvider } from '@mui/material'
import { joblistSearch } from '../sevices/account';

function JobListing() {
  const [job, setJob] = useState({ title: '', description: '' });
  const imagePath = require('../assets/images/com-logo-3.png'); // Ensure you have the correct path to your image

  const navigate = useNavigate();


  const jobs = [
    { title: 'Job 1', description: 'Description 1' },
    { title: 'Job 2', description: 'Description 2' },
    { title: 'Job 3', description: 'Description 3' },
    { title: 'Job 4', description: 'Description 4' },
    { title: 'Job 5', description: 'Description 5' },
    { title: 'Job 5', description: 'Description 5' },
    { title: 'Job 5', description: 'Description 5' },
    { title: 'Job 5', description: 'Description 5' },
    { title: 'Job 5', description: 'Description 5' },
    { title: 'Job 5', description: 'Description 5' },
  ];

  const handleNavigate = (e) => {
    e.preventDefault();
    navigate("/jobview")
  }



  const handleJobList = async () => {

    const body = {

    }

    try {
      const dataList = await joblistSearch(body)
      console.log(dataList)

    } catch (error) {

      console.log(error);

    }
  }


  useEffect(() => {
    handleJobList()
  }, [])

  return (
    <div className="container my-5">
      <div className="row mb-4">
        <div style={{ width: 500 }}>
          <input style={{ height: 50 }} type="text" className="form-control" placeholder="Search Skills,title....." />
        </div>
      </div>
      <div className="row">
        {jobs?.map((job, index) => (
          <div className="col-lg-3 col-md-4 col-sm-6 mb-4" key={index}>
            <div className="card custom-card">
              <img
                style={{ width: '20%', height: 'auto' }}
                src={imagePath}
                className="card-img-top"
                alt="..."
              />
              <div className="card-body">
                <h5 className="card-title">{job.title}</h5>
                <p className="card-text">Lorem ipsum dolor sit amet consectetur adipisicing elit. deserunt quasi!</p>
                <Button style={{ outlineColor: "black" }} variant="outlined" onClick={(e) => handleNavigate(e)}>Apply for this job</Button>
                {/* <Button type="submit" style={{ display: 'flex', outlineColor: "black", left: 400, width: 300, margin: 30 }}>Submit </Button> */}

              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default JobListing;
